INSERT INTO public.book_details (id, description, source, book_id) VALUES (1, 'Convinced that there is something creepy about his new piano  teacher, Jerry soon hears terrifying stories about Dr. Shreek''s music  school and students who never completed their lesson alive. \n\n', 0, 2);
INSERT INTO public.book_details (id, description, source, book_id) VALUES (2, 'Years of caring for her needy family have left Merritt Fowler exhausted and confused, uncertain of who she is or what she wants. When a family argument sends her lovely, fragile daughter, Glynn, running from her Atlanta home to her Aunt Laura in Hollywood, Merritt is compelled to follow.   On impulse, the trio takes off in Laura''s red Mustang convertible, barreling up the coast to the lush wilderness outside San Francisco -- earthquake country. There, amid the beauty and protection of the mounta', 0, 4);
INSERT INTO public.book_details (id, description, source, book_id) VALUES (3, '“A big, blowzy romp through the rainbow eccentricities of three generations of crazy bayou debutantes.”—Atlanta Journal-Constitution“A very entertaining and, ultimately, deeply moving novel about the complex bonds between mother and daughter.”—Washington Post“Mary McCarthy, Anne Rivers Siddons, and a host of others have portrayed the power and value of female friendships, but no one has done it with more grace, charm, talent, and power than Rebecca Wells.”—Richmond Times-Dispat', 0, 7);
INSERT INTO public.book_details (id, description, source, book_id) VALUES (4, 'Requesting a new dummy when her old one loses its head, young  ventriloquist Amy receives Slappy, a strange, used dummy that moves of  its own accord and disrupts things with the intent of making Amy''s life  miserable.\n\n', 0, 8);
INSERT INTO public.book_details (id, description, source, book_id) VALUES (5, 'The citizens of Moonlight Cove are changing. Some are losing touch with their deepest emotions. Others are surrendering to their wildest urges. And the few who remain unchanged are absolutely terrified—if not brutally murdered in the dead of night. Enter the shocking world of Moonlight Cove, where four unlikely survivors confront the darkest realms of human nature...\n\n', 0, 9);
INSERT INTO public.book_details (id, description, source, book_id) VALUES (6, 'Eddie and his friends plan to dress up as the slimy Mud  Monsters--legendary spooks who supposedly live in Muddy Creek--but  their plans change when they meet the real Mud Monsters.\n\n', 0, 10);
INSERT INTO public.book_details (id, description, source, book_id) VALUES (7, 'Cooper, a nervous newcomer to the town, and his friend Margaret  are targeted by two evil dogs who cast a spell to switch bodies with  the children as a way of wreaking further havoc. \n\n', 0, 23);
INSERT INTO public.book_details (id, description, source, book_id) VALUES (8, 'Tiger Ann Parker is smart in school and good at baseball, but she''s forever teased about her family by the girls in class. Tiger Ann knows her folks are different from others in their small town of Saitter, Louisiana. They are mentally slow, and Tiger Ann keeps her pain and embarrassment hidden as long as her strong and smart Granny runs the household. Then Granny dies suddenly and Aunt Dorie Kay arrives, offering Tiger Ann a way out. Now Tiger Ann must make the most important decision of her li', 0, 25);
INSERT INTO public.book_details (id, description, source, book_id) VALUES (9, 'Sheila Tubman sometimes wonders who she really is: the outgoing, witty, and capable Sheila the Great, or the secret Sheila, who''s afraid of the dark, spiders, swimming, and dogs.When her family spends the summer in Tarrytown, Sheila has to face some of her worst fears. Not only does a dog come with the rented house, but her parents expect Sheila to take swimming lessons! Sheila does her best to pretend she''s an expert at everything, but she knows she isn''t fooling her new best friend, Mouse Elli', 0, 27);
INSERT INTO public.book_details (id, description, source, book_id) VALUES (10, 'Rick Dockery was the third-string quarterback for the Cleveland Browns. In the AFC Championship game, to the surprise and dismay of virtually everyone, Rick actually got into the game. With a 17-point lead and just minutes to go, Rick provided what was arguably the worst single performance in the history of the NFL. Overnight, he became a national laughingstock—and was immediately cut by the Browns and shunned by all other teams. But all Rick knows is football, and he insists that his agent fi', 0, 39);
INSERT INTO public.book_details (id, description, source, book_id) VALUES (11, 'Jake has made an amazing discovery: a web site about the Yeerks. Should the Animorphs investigate? If they do, they might walk right into a trap. And if they don''t, they''ll never know if they''re fighting their enemies alone. (Digest) .\n\n', 0, 41);
INSERT INTO public.book_details (id, description, source, book_id) VALUES (12, 'No one can weave a web of suspense, deliver a jolt of surprise, or teach a lesson in living like bestselling author Jeffrey Archer. From Africa to the Middle East, and from London to Beijing, Archer takes us to places we''ve never seen and introduces us to people we''ll never forget.Meet the philandering husband who thinks he''s committed the perfect murder; the self-assured chess champion who plays a beautiful woman for stakes far higher than cash; and the finance minister who needs to crack the s', 0, 42);
INSERT INTO public.book_details (id, description, source, book_id) VALUES (13, 'Winner of the Newbery Medal A New York Times Book Review Best of Children''s Books A National Book Award NomineeWhy is the land so important to Cassie''s family? It takes the events of one turbulent year—the year of the night riders and the burnings, the year a white girl humiliates Cassie in public simply because she''s black—to show Cassie that having a place of their own is the Logan family''s lifeblood. It is the land that gives the Logans their courage and pride—no matter how others may d', 0, 49);
INSERT INTO public.book_details (id, description, source, book_id) VALUES (14, 'Winner of the Newbery Medal A New York Times Book Review Best of Children''s Books A National Book Award NomineeWhy is the land so important to Cassie''s family? It takes the events of one turbulent year—the year of the night riders and the burnings, the year a white girl humiliates Cassie in public simply because she''s black—to show Cassie that having a place of their own is the Logan family''s lifeblood. It is the land that gives the Logans their courage and pride—no matter how others may d', 0, 49);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (1, 'A little damage to the back cover, but otherwise great condition.', NULL, 1, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (2, 'Brooke''s best friend, Zeke, has been given the lead role in the school lay, The Phantom. Zeke''s totally into it. He loves dressing up in the grotesque phantom costume. And scaring the other members of the cast. Brooke thinks Zeke''s getting a little too into it. But then really scary things start happening. A messsage appears on a piece of scenery: The Phantom Strikes! A stage light comes crashing down. Is someone trying to ruin the play? Or is there really a phantom living under the stage?', NULL, 2, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (3, 'Explores the emotional baggage we all carry from past relationships - and how it affects present and future relationships, and how important forgiveness is sometimes.  Sad, funny, thoughtful.', NULL, 3, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (4, 'Amy''s ventriloquist dummy, Dennis, keeps losing his head...for real. So Amy begs her family for a new dummy. That''s when her dad finds Slappy in a local pawnshop. Slappy is kind of ugly, but at least his head stays on! Besides, Amy''s having fun practicing her new routine. There''s something odd about Slappy; something not quite right.  It''s like this dummy knows what she''s thinking.', NULL, 3, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (5, 'excellent condition', NULL, 4, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (6, 'It was a really good book.', NULL, 5, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (7, 'This book is part of the Accelerated Reader program used in many schools across the country.    It is reading level 4.5, worth 5.0 AR points.', NULL, 6, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (8, 'Know a young person? Get them off the street and into a book -- this one''s a great one to get them thinking and using their imagination.', NULL, 6, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (9, 'Amazon.com\r\nScott O''Dell won the Newbery Medal for Island of the Blue Dolphins in 1961, and in 1976 the Children''s Literature Association named this riveting story one of the 10 best American children''s books of the past 200 years. O''Dell was inspired by the real-life story of a 12-year-old American Indian girl, Karana. The author based his book on the life of this remarkable young woman who, during the evacuation of Ghalas-at (an island off the coast of California), jumped ship to stay with h', NULL, 7, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (10, 'This is a great book, For the young and old. My 12 year old daughter enjoyed this book ever so much!!!', NULL, 7, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (11, 'In the Pacific there is an island that looks like a big fish sunning itself in the sea. Around it, blue dolphins swim, otters play, and sea elephants and sea birds abound. Once, Indians also lived on the island. And when they left and sailed to the east, one young girl was left behind. \r\n\r\nThis is the story of Karana, the Indian girl who lived alone for years on the Island of the Blue Dolphins. Year after year, she watched one season pass into another and waited for a ship to take her away. ', NULL, 7, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (12, 'I loved this book very much as a child, read it again as a teen. It sets ones senses to wander...the sensitivity of this writer takes you to places beyond imagining. Adults will also be captivated by this true story of the bravery of a young woman and a life well lived, on an island, alone. I am planning to read my daughter book again very soon, and I don''t believe i have ever read any book so happily as this one, knowing how this girls story rewards the soul.', NULL, 7, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (13, 'I read this book as a child. Then I went to the beach to see if I could see San Nicholas Island. It was thrilling to read history right from where I was. Also thrilled when my son''s class read it for school.Its  a good book', NULL, 7, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (14, 'good condition. cover is slightly different then the one shown.', NULL, 8, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (15, 'From Amazon.com:\r\n\r\nAmazon.com\r\nThis large, deluxe hardcover edition of the first title in the classic Chronicles of Narnia series, The Magician''s Nephew, is a gorgeous introduction to the magical land of Narnia. The many readers who discovered C.S. Lewis''s Chronicles through The Lion, the Witch, and the Wardrobe will be delighted to find that the next volume in the series is actually the first in the sequence--and a step back in time. In this unforgettable story, British schoolchildren Po', NULL, 9, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (16, 'Loved the whole series.  Beautiful on the surface...and thought provoking deep within.', NULL, 9, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (17, 'A great series.', NULL, 10, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (18, 'My daughters liked this book.', NULL, 11, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (19, 'This is a great series that my 9 year old son and I are reading together.  I had read the adult series and this is interesting to me also.  As it follows along the same story line as the adult books.', NULL, 12, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (20, 'I liked Tiger Ann Parker, the heroine, whose parents are slow, and whose grandmother runs the household.  This is a Young Adult read, although any agegroup will find something to take away from in this book.', NULL, 13, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (21, 'A great book that I read with my bible study group, but can be read at anytime in your life, even if you don''t attend church.', NULL, 10, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (22, 'I breezy read, not earth shaking in the least for diffrent for Grisham', NULL, 11, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (23, 'I loved this book.  Grisham is an expert storyteller.  The book was also an excellant tour guide of Italy.', NULL, 12, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (24, 'great book great part of a series', NULL, 13, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (25, 'A collection of short stories that do not turn out as you expected. Love/hate. Loved the stories, hated that they ended without more. lol\r\nA few AMAZING ones! Just Good Friends was my absolute favorite!!', NULL, 13, NULL);
INSERT INTO public.book_comments (id, content, parent_id, book_detail_id, user_id) VALUES (26, 'Make a wish! Samantha Byrd is a klutz... an accident waiting to happen. She''s the laughingstock of the girls'' basketball team. And that mean, rotten Judith Bellwood is making her life miserable on and off the court. But everything''s about to change. Sam''s met someone who can grant her three wishes. For real. Too bad Sam wasn''t careful what she wished for. Because her wishes are coming true. And they''re turning her life into a living nightmare!', NULL, 13, NULL);
